import React from "react";
import "./Card.css";

function Card({ item }) {
  return (
    <>
      <div className="box">
        <img src="" alt="" />
        <div className="name">
          <p>{item.name}</p>
        </div>
        <div className="price">
          <span>{item.price}</span>
        </div>
        <div className="buttom"></div>
      </div>
    </>
  );
}

export default Card;
